import React from "react";
import { Link } from "react-scroll";
import "../css/style.css";
import "../css/tailwind.css";
import logo from "../asset/navbar.png";

function Navbar() {
  const navStyle = { width: "100px", textAlign: "center" };
  return (
    <div className="flex bg-dark text-white">
      <img
        className="mr-auto ml-10 z-10"
        height={"0px"}
        src={logo}
        alt="logo"
      />
      <ul className="flex items-center justify-end text-stabilo text-xl py-5 mr-10">
        <li style={navStyle}>
          <Link
            to="me"
            spy={true}
            smooth={true}
            offset={-68}
            duration={1000}
            className="nav-button"
          >
            <span>Home</span>
            <span className="nav-hover">/ Home /</span>
          </Link>
        </li>
        <li style={navStyle}>
          <Link
            to="aboutme"
            spy={true}
            smooth={true}
            offset={-68}
            duration={1000}
            className="nav-button"
          >
            <span>About</span>
            <span className="nav-hover">/ About /</span>
          </Link>
        </li>
        <li style={navStyle}>
          <Link
            to="resume"
            spy={true}
            smooth={true}
            offset={-68}
            duration={1000}
            className="nav-button"
          >
            <span>Resume</span>
            <span className="nav-hover">/ Resume /</span>
          </Link>
        </li>
        <li style={navStyle}>
          <Link
            to="projects"
            spy={true}
            smooth={true}
            offset={-68}
            duration={1000}
            className="nav-button"
          >
            <span>Projects</span>
            <span className="nav-hover">/ Projects /</span>
          </Link>
        </li>
        <li className="hidden md:block" style={navStyle}>
          <Link
            to="contact"
            spy={true}
            smooth={true}
            offset={-68}
            duration={1000}
            className="nav-button"
          >
            <span>Contact</span>
            <span className="nav-hover">/ Contact /</span>
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
